@kylebarron 

I believe according to this page, https://belloliva.wordpress.com/2017/10/27/embed-svg-into-jupyter-notebook/, It might be possible to return HTML snippets to jupyter using ```IPython.core.display.HTML```? I am not sure if it is also the case for a custom kernel.

And so much thanks for reporting this bug to Stata! But I wouldn't expect them to fix this issues very soon. It might be helpful to implement a magic that replaces the path ID with hash, so that the potential side effects are minimal.
